@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Chek';
}
<!-- login.component.html -->
<form>
  <mat-form-field>
    <input matInput placeholder="Usuario" name="username">
  </mat-form-field>
  <mat-form-field>
    <input matInput type="password" placeholder="Contraseña" name="password">
  </mat-form-field>
  <button mat-button> Iniciar sesión </button>
</form>
